css:
.merge-conflicts .navigate {
  cursor: pointer;
}
.merge-conflicts .navigate:hover {
  background-color: rgba(0, 0, 0, 0.1);
}
.merge-conflicts span.icon-fold {
  cursor: pointer;
}
.merge-conflicts span.icon-unfold {
  display: none;
  cursor: pointer;
}
.merge-conflicts.minimized span.icon-fold {
  display: none;
}
.merge-conflicts.minimized span.icon-unfold {
  display: inline-block;
}
.merge-conflicts-message {
  cursor: pointer;
}
.resolver.save-needed .save .text-success {
  display: none;
}
.resolver.save-needed .save .text-status {
  display: inline-block;
}
.resolver.save-needed .stage {
  display: none;
}
.resolver.stage-needed .stage .text-success {
  display: none;
}
.resolver.stage-needed .stage .text-status {
  display: inline-block;
}
.resolver .save .text-status {
  display: none;
}
.resolver .stage .text-success {
  display: none;
}
.panes .pane .item-views > .react > .overlay.resolver {
  left: 50%;
  padding: 10px;
  bottom: auto;
}
.editor.conflicted .conflict-line {
  width: 100%;
}
.editor.conflicted .conflict-line.ours {
  background: #86dfad;
}
.editor.conflicted .conflict-line.ours.cursor-line {
  background: #5dd491;
}
.editor.conflicted .conflict-line.theirs {
  background: #7ac6fa;
}
.editor.conflicted .conflict-line.theirs.cursor-line {
  background: #49b1f7;
}
.editor.conflicted .conflict-line.resolved {
  background: rgba(0, 0, 0, 0.1);
}
.editor.conflicted .conflict-line.dirty {
  background: #433d03;
}
.editor.conflicted .conflict-line.dirty.cursor-line {
  background: #746a05;
}
.editor.conflicted .side {
  padding: 0 20px;
  width: 100%;
  position: absolute;
  left: 0;
}
.editor.conflicted .side span {
  margin-left: 10px;
}
.editor.conflicted .side span.pull-right {
  clear: right;
  margin-right: 20px;
}
.editor.conflicted .side button.revert {
  display: none;
}
.editor.conflicted .side.top {
  border-top-left-radius: 5px;
  border-top-right-radius: 5px;
}
.editor.conflicted .side.top button {
  margin-top: 5px;
}
.editor.conflicted .side.bottom {
  border-bottom-left-radius: 5px;
  border-bottom-right-radius: 5px;
}
.editor.conflicted .side.bottom button {
  margin-top: -35px;
}
.editor.conflicted .side.dirty {
  background-color: #f5e11d;
}
.editor.conflicted .side.dirty button.revert {
  display: inline-block;
}
.editor.conflicted .navigation {
  padding: 0 20px;
  background: #f4f4f4;
  width: 100%;
  position: absolute;
  left: 0;
}
.editor.conflicted .navigation span.pull-right {
  clear: right;
  margin-right: 20px;
}
.editor.conflicted .navigation button {
  margin-left: 5px;
  margin-top: -15px;
}
